sympy.sympy.polys.domains.polynomialring:
@property
def one(self) -> PolyElement[Er]: # type: ignore
    return self.ring.one

sympy.sympy.polys.rings.zero:
@property
def zero(self) -> PolyElement[Er]:
    """The zero polynomial."""
    return self.dtype([])

sympy.sympy.polys.rings.monomial_basis:
def monomial_basis(self, i) -> tuple[int, ...]:
    """Return the i-th basis element."""
    basis = [0] * self.ngens
    basis[i] = 1
    return tuple(basis)
